interface NoteItemCellProps {
    children: any,
    isBig: boolean,
}

const NoteItemCell: React.FC<NoteItemCellProps> = ({
    children,
    isBig
}) => {

  const cl = 'notesTableCell' + isBig ? ' bigItem' : '';

  return (
    <div className={cl}>
        {children}
    </div>
  );
}
  
  
export default NoteItemCell;
